import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
const root = ReactDOM.createRoot(document.getElementById("root"));
let name = "ali";
root.render(
  <>
    <Text text={name} text1="red" />

    <Text1 />
  </>
);

function Text(props) {
  console.log(props.text);
  return (
    <div>
      <p>{props.text}</p>
      <p>{props.text1}</p>
    </div>
  );
}
function Text1() {
  return <p>ipsun</p>;
}
